import React, { Component } from "react";
import Slider from "./components/NetflixSlider";
import "./App.scss";

const movies = [
  {
    id: 1,
    image:
      "/images/imagesimported/resized_images_2/Screen Shot 2020-07-08 at 125813 PM.jpg",
    imageBg:
      "/images/imagesimported/resized_images_2/Screen Shot 2020-07-08 at 125813 PM.jpg",
    title: "Slide One",
    transitionTime: 500,
    transitionSize:30,
  },
  {
    id: 2,
    image:
      "/images/imagesimported/resized_images_2/Screen Shot 2020-07-08 at 125833 PM.jpg",
    imageBg: "/images/slide2b.webp",
    title: "Slide Two",
    transitionTime:300,
    transitionSize : 40,
  },
  {
    id: 3,
    image:
      "/images/imagesimported/resized_images_2/Screen Shot 2020-07-08 at 125856 PM.jpg",
    imageBg: "/images/slide3b.webp",
    title: "Slide Three",
    transitionTransform:200,
    transitionSize : 50,
  },
  {
    id: 4,
    image: "/images/imagesimported/resized/background1.jpg",
    imageBg: "/images/slide4b.webp",
    title: "Slide Four",
    transitionTransform:200,
    transitionSize : 50,
  },
  {
    id: 5,
    image: "/images/imagesimported/resized/background2.jpg",
    imageBg: "/images/slide5b.webp",
    title: "Slide Five",
    transitionTransform:500,
    transitionSize : 50,
  },
  {
    id: 6,
    image: "/images/imagesimported/resized/background5.jpg",
    imageBg: "/images/slide6b.webp",
    title: "Slide Six",
    transitionTransform:100,
    transitionSize : 50,
  },
  {
    id: 7,
    image:
      "/images/imagesimported/resized_images_2/Screen Shot 2020-07-08 at 125750 PM.jpg",
    imageBg: "/images/slide6b.webp",
    title: "Slide Seven",
    transitionTransform:150,
    transitionSize : 20,
  },
];

class App extends Component {
  render() {
    return (
      <div className="app">
        <h1 style={{ color: "white", paddingLeft: "20px", paddingTop: "20px" }}>
          Slider One
        </h1>
        <Slider>
          {movies.map((movie) => (
            <Slider.Item movie={movie} key={movie.id}>
              item1
            </Slider.Item>
          ))}
        </Slider>
        <h1 style={{ color: "white", paddingLeft: "20px", paddingTop: "20px" }}>
          Slider Two
        </h1>
        <Slider>
          {movies.map((movie) => (
            <Slider.Item movie={movie} key={movie.id}>
              item1
            </Slider.Item>
          ))}
        </Slider>
        <h1 style={{ color: "white", paddingLeft: "20px", paddingTop: "20px" }}>
          Slider Three
        </h1>
        <Slider>
          {movies.map((movie) => (
            <Slider.Item movie={movie} key={movie.id}>
              item1
            </Slider.Item>
          ))}
        </Slider>
      </div>
    );
  }
}

export default App;
